// ==UserScript==
// @name         Github一键返回顶部
// @namespace    https://arley.cn/
// @version      1.1
// @description  Github返回顶部
// @author       Arley
// @match        https://github.com/*
// @icon         https://github.githubassets.com/favicons/favicon-dark.png
// @grant        none
// ==/UserScript==

(function() {
    'use strict';
    let css=`
           .goup {
            cursor: pointer;
           	top: 75vh;
           	position: fixed;
           	right: 1vw;
           	font-family: 'Open Sans', sans-serif;
           	padding: 0;
           	font-size: inherit;
           	color: inherit;
           	box-sizing: inherit;
           	backface-visibility: hidden;
           	-webkit-font-smoothing: antialiased;
           	text-decoration: none;
           	transition: all 0.35s;
           	transition-timing-function: cubic-bezier(0.31, -0.105, 0.43, 1.59);
           	display: inline-block;
           	width: 90px;
           	height: 90px;
           	line-height: 90px;
           	margin: 0 10px;
           	text-align: center;
           	overflow: hidden;
           	opacity: 0.99;
           	background-position: center;
           	background-image: url('data:image/png;base64,');
           	background-repeat: no-repeat;
           	background-size: 50%;
           }
           .goup:hover{
           background-size: 80%;
           }
    `;
    document.getElementsByTagName('style')[0].textContent+=document.getElementsByTagName('style')[0].textContent+css;
    let body = document.querySelector('body');
    let a=document.createElement('i');
    a.className='goup';
    a.style.display='none'
    body.appendChild(a);
    let now =document.documentElement.scrollTop||document.body.scrollTop;
    if(now>window.innerHeight){
       a.style.display='block';
    }
    a.onclick=function(){
        window.scrollTo({
           top: 0,
           behavior: 'smooth',
        });
      return false;
    }
    window.onscroll=function(){
      let t =document.documentElement.scrollTop||document.body.scrollTop;
      if(t>window.innerHeight){
          a.style.display='block';
      }else{
          a.style.display='none';
      }
    }
})();